DROP TABLE IF EXISTS `bookings`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `bookings` (
  `id` int NOT NULL AUTO_INCREMENT,
  `displayID` varchar(255) DEFAULT NULL,
  `adultCount` int NOT NULL,
  `childCount` int NOT NULL,
  `checkIn` date NOT NULL,
  `checkOut` date NOT NULL,
  `actualCheckOut` date DEFAULT NULL,
  `roomCount` int NOT NULL,
  `finalPrice` float NOT NULL,
  `checkOutFinalPrice` float DEFAULT NULL,
  `cardUpdateNeeded` tinyint(1) DEFAULT NULL,
  `cardUpdateDate` datetime DEFAULT NULL,
  `cancellationAmount` float DEFAULT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime DEFAULT NULL,
  `bookingUserId` int DEFAULT NULL,
  `bookingStatusId` int DEFAULT NULL,
  `bookingLoyaltyId` int DEFAULT NULL,
  `bookingPromoCodeId` int DEFAULT NULL,
  `bookingCardId` int DEFAULT NULL,
  `branchId` int DEFAULT NULL,
  `userId` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `bookingUserId` (`bookingUserId`),
  KEY `bookingStatusId` (`bookingStatusId`),
  KEY `bookingLoyaltyId` (`bookingLoyaltyId`),
  KEY `bookingPromoCodeId` (`bookingPromoCodeId`),
  KEY `bookingCardId` (`bookingCardId`),
  KEY `branchId` (`branchId`),
  KEY `userId` (`userId`),
  CONSTRAINT `bookings_ibfk_1` FOREIGN KEY (`bookingUserId`) REFERENCES `booking_users` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `bookings_ibfk_2` FOREIGN KEY (`bookingStatusId`) REFERENCES `booking_statuses` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `bookings_ibfk_3` FOREIGN KEY (`bookingLoyaltyId`) REFERENCES `booking_loyalties` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `bookings_ibfk_4` FOREIGN KEY (`bookingPromoCodeId`) REFERENCES `booking_promo_codes` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `bookings_ibfk_5` FOREIGN KEY (`bookingCardId`) REFERENCES `booking_cards` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `bookings_ibfk_6` FOREIGN KEY (`branchId`) REFERENCES `branches` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `bookings_ibfk_7` FOREIGN KEY (`userId`) REFERENCES `users` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=584 DEFAULT CHARSET=utf8;
