INSERT INTO `branches` VALUES (1,'Lavilla Hotel','فندق لافيلا','Conveniently located in the midst of the historically colorful vicinity of Doha\'s main market, Souq Waqif, Gold Souq and Bank Street, La Villa Hotel is just a short walk away from the Museum of Islamic Art and authentic cuisines of Souq Waqif. This budget hotel is just minutes away from the glitz and glamour of Al Corniche and other tourist attractions at Doha. La Villa Hotel is a 10-minute drive from the West Bay Business District and with a 5-minute drive to Doha International Airport, it offers the guests budget accommodation at a convenient location.\n','يقع فندق لافيلا في مكان ملائم وسط المنطقة الحيوية بالقرب من السوق الرئيسي في الدوحة وسوق واقف وسوق الذهب وشارع البنوك والمتحف الفن الإسلامي والكورنيش وغيرها من المعالم السياحية في الدوحة. يقع فندق لافيلا على بعد 10 دقائق بالسيارة من منطقة الخليج العربي التجاري وعلى بعد 5 دقائق بالسيارة من مطار الدوحة الدولي ، وهو يوفر إقامة اقتصادية للنزلاء في موقع مناسب.','Behind Gold Souq,\nIbnAqeel Street,\nDoha-Qatar','خلف سوق الذهب ،\nشارع ابن عقيل ،\nالدوحة - قطر',1,25.28575073813806,51.53889295180716,5,'2020-06-24 07:42:06','2021-02-28 18:37:21',196),(2,'Lavilla Inn Hotel Apartment ','لافيلا إن للشقق الفندقية','La Villa Inn is a Deluxe Hotel Apartments elegantly designed to provide sophisticated services to business travelers, couples and family vacationers, with 88 luxurious suites & one bedroom apartments, decorated to create an outstanding elegance. La Villa Inn Hotel Apartments are fully furnished along with full kitchen appliances. The apartments are lavishly decorated with all house-hold equipment and daily services including 24 hours room service, Concierge and Housekeeping. Hotel & Suites offers a variety of suites and apartments for long and short accommodation in Doha. The hotel apartments offers roundtrip airport shuttle. ','لا فيلا إن للشقق الفندقية مصمم بأناقة لتقديم خدمات متطورة للمسافرين من رجال الأعمال والعائلات يتضمن 88 جناحًا فاخرًا وشقة بغرفة نوم واحدة  مصممة لخلق أناقة رائعة. يوفر فندق لا فيلا إن للشقق الفندقية الفندقية بأدوات مطبخ كاملة  بجميع المعدات المنزلية والخدمات اليومية بما في ذلك خدمة الغرف على مدار 24 ساعة ، والحراسة والنظافة المنزلي. يقدم الفندق و الأجنحة مجموعة متنوعة من الشقق والأجنحة الخاصة باللإقامة الطويلة والقصيرة في الدوحة. توفر الشقق الفندقية خدمة نقل المطار ذهابًا وإيابًا.','La Villa Inn Hotel Apartments\nOpp to Gate No.2,\nSouq Al Harage,\nNajma,\nDoha – Qatar.','لا فيلا إن للشقق الفندقية\nمقابل البوابة رقم 2 ،\nسوق الحراج ،\nمنطقة نجمة ،\nالدوحة - قطر.',1,25.27161086192865,51.53849062045493,5,'2020-06-24 07:46:16','2021-03-10 15:34:11',196),(3,'Lavilla Palace Hotel ','فندق لافيلا بالاس','The La Villa Palace Hotel brings to you a wide selection of room’s /suites designed with the exclusive intention of pampering guest by providing elegant and comfortable rooms. Well-designed interiors, a pleasing ambience and the most indulgent service. All rooms and Suites equipped with tea & coffee maker, fridge, iron & ironing board, hair dryer, in-room safety box, fully air-conditioned rooms, satellite TV, high speed internet connection and direct dialing telephone facilities, laundry and dry cleaning.\n\n','يوفر لك فندق لافيلا بالاس مجموعة واسعة من الغرف / الأجنحة المصممة بإسلوب انيق  لترفية  النزلاء من خلال توفير غرف أنيقة ومريحة.ومساحات داخلية مصممة تصميماً جيداً وأجواء ممتعة وخدمة أكثر راحة. جميع الغرف والأجنحة مجهزة بآلة لصنع الشاي والقهوة وثلاجة ومكواة وطاولة للكي ومجفف شعر وخزانة أمانات في الغرف وغرف مكيفة بالكامل وتلفزيون مزود  بقنوات فضائية وخدمة إنترنت عالية السرعة وخدمات هاتف للاتصال المباشر والغسيل والتنظيف جاف .','Ibn Abdul Muttalib Street, Near Dar Al Kutub Round About','شارع ابن عبد المطلب بالقرب من دوار دار الكتب\n',1,25.281496821769245,51.539853182634495,NULL,'2020-06-24 07:59:17','2020-08-06 07:32:59',196),(4,'Lavilla Suites Hotel','فندق لافيلا سويتس','La Villa Suites Hotel is elegantly designed to provide sophisticated services to business travelers, couples and family vacationers, with 56 luxurious suites, decorated to create an outstanding elegance and comfortable. Well-designed interiors, a pleasing ambience and the most indulgent service. La Villa Suites offers a variety of suites for long and short accommodation in Doha.\nGuest rooms at the hotel come with a seating area, a TV with satellite channels and a private bathroom with a hair dryer and a shower tray. Rooms are equipped with a kitchenette with stove, microwave and a fridge. Enjoy tea and coffee provisions for a freshly brewed beverage in the comfort of your room.\n\n','تم تصميم اجنحة لافيلا الفندقية  بأناقة لتوفير خدمات راقية للمسافرين من رجال الأعمال والأزواج والأسر المصطافين ، بالإضافة إلى 56 جناحًا فاخرًا مصممًا لخلق أناقة ومريحة. مساحات داخلية مصممة تصميماً جيداً وأجواء ممتعة وخدمة أكثر راحة. تقدم أجنحة لافيلا الفندقية مجموعة متنوعة من الأجنحة للإقامة الطويلة والقصيرة في الدوحة. تحتوي غرف الضيوف في الفندق على منطقة جلوس وتلفزيون مزود بقنوات فضائية وحمام خاص مع مجفف شعر ودش. تم تجهيز الغرف بمطبخ صغير مع موقد وميكروويف وثلاجة.يمكنك  الاستمتاع بأدوات الشاي والقهوة لتناول مشروب طازج في راحة غرفتك.','Opp to Gate No.1,\nSouq Al Harage,\nNajma,\nDoha – Qatar.','مقابل البوابة رقم 1 ،\nسوق الحراج ،\nنجمة ،\nالدوحة قطر.\n',1,25.270533932476805,51.53876957019248,5,'2020-06-24 08:01:57','2021-01-29 03:44:17',196);
