INSERT INTO `events` VALUES (4,' Sabkhat Marmi - Mesaieed (Sealine)','سبخة مرمي - مسيعيد (سيلين)','Location: Sabkhat Marmi - Mesaieed (Sealine)\nDate: 1 January 2021 - 31 January 2021\nTime: 12:00 am - 12:00 am\nTicket Purchase: No tickets needed\nPrice:\nPhone: +97444081490\nEmail: algannas-qtr@katara.net\nWebsite: http://www.algannas.net/\nThe registration for the 12th Marmi Festival will start on 22 - 24 Dec 2020 at AlGannas Qatari Society building 33, in Katara.','الموقع: سبخة مرمي - مسيعيد (سيلين)\nالتاريخ: 1 يناير 2021-31 يناير 2021\nالوقت: 12:00 ص - 12:00 ص\nشراء التذاكر: لا حاجة للتذاكر\nالسعر:\nهاتف: +97444081490\nبريد إلكتروني: algannas-qtr@katara.net\nالموقع: http://www.algannas.net/\nسيبدأ التسجيل في مهرجان مرمي الثاني عشر في الفترة من 22 إلى 24 ديسمبر 2020 في مبنى جمعية القناص القطرية 33 في كتارا.','uploads/events/eventImage_1609665027276_Marmi-Festival-2021.jpeg','2021-01-10',1,'2021-01-03 09:10:28','2021-01-03 09:10:33'),(5,'5th Mahaseel Festival at Katara','مهرجان محصول الخامس بكتارا','Location: Katara’s Southern Area\nDate: 23 December 2020 - 2 January 2021\nTime: 09:00 am - 09:00 pm\nTicket Purchase: No tickets needed\nPrice:\nPhone: 182\nWebsite: https://www.katara.net/\nKatara has announced once again it will organise Mahaseel Festival this year to offer consumers local produce freshly picked from Qatari farms.\n\nMahaseel Festival will open on December 23 and run until January 2 from 9am to 9pm at Katara’s Southern Area, after which the Mahaseel souq will continue to be open on Thursdays, Fridays and Saturdays until March 31.','الموقع: المنطقة الجنوبية في كتارا\nالتاريخ: 23 ديسمبر 2020-2 يناير 2021\nالوقت: 09:00 صباحًا - 09:00 مساءً\nشراء التذاكر: لا حاجة للتذاكر\nالسعر:\nالهاتف: 182\nالموقع: https://www.katara.net/\nأعلنت كتارا مرة أخرى أنها ستنظم مهرجان محاصيل هذا العام لتزويد المستهلكين بالمنتجات المحلية الطازجة المختارة من المزارع القطرية.\n\nسيفتتح مهرجان محاصيل في 23 ديسمبر ويستمر حتى 2 يناير من الساعة 9 صباحًا حتى 9 مساءً في المنطقة الجنوبية بكتارا ، وبعد ذلك سيستمر سوق محاصيل أبوابه أيام الخميس والجمعة والسبت حتى 31 مارس.','uploads/events/eventImage_1609665142989_5th-Mahaseel-Festival-at-Katara.jpg','2021-01-25',1,'2021-01-03 09:12:23','2021-01-03 09:26:42');
